import React, { Component } from 'react'
import Child from './Child'

export default class Error extends Component {

    state={hasError:''}

    static getDerivedStateFromError(error){
        console.log(error)
        return {hasError:error}
    }

    render() {
        return (
            <div>
                <Child/>
            </div>
        )
    }
}
